INSERT INTO `team_members` (`id`, `name`, `title`, `bio`, `image`, `created_at`, `updated_at`) VALUES
(1, '{\"en\":\"Ricardo Figuerido\",\"fr\":\"Ricardo Figuerido\",\"pt\":\"Ricardo Figuerido\"}', '{\"en\":\"CEO\",\"fr\":\"PDG\",\"pt\":\"IDK\"}', '{\"en\":\"My world cracked open one day while sitting on a simple brown bench listening to the flowing water pass by. It\'s when I first was reminded of my forgotten ability to lucid dream.\\n\\nFrom that moment in time 10 years ago, my life has been dedicated to unraveling the mysteries of life in their magic and intrigue.\\n\\nMy search has taken on many forms: from the halls of UC Berkeley, to the hustle of startup life in Silicon Valley, to obscure temples and ashrams in india. A long travel to come back home into the heart.\\n\\nFrom that home comes the offering of BookRetreats.com. A synergy of my passions: Yoga, the internet, and entrepreneurship. The integration of spirituality and the creative business spirit. I\'m happy you\'re joining the journey :)\",\"fr\":\"My world cracked open one day while sitting on a simple brown bench listening to the flowing water pass by. It\'s when I first was reminded of my forgotten ability to lucid dream.\\n\\nFrom that moment in time 10 years ago, my life has been dedicated to unraveling the mysteries of life in their magic and intrigue.\\n\\nMy search has taken on many forms: from the halls of UC Berkeley to the hustle of startup life in Silicon Valley, to obscure temples and ashrams in india. A long travel to come back home into the heart.\\n\\nFrom that home comes the offering of BookRetreats.com. A synergy of my passions: Yoga, the internet, and entrepreneurship. The integration of spirituality and the creative business spirit. I\'m happy you\'re joining the journey :)\",\"pt\":\"My world cracked open one day while sitting on a simple brown bench listening to the flowing water pass by. It\'s when I first was reminded of my forgotten ability to lucid dream.\\n\\nFrom that moment in time 10 years ago, my life has been dedicated to unraveling the mysteries of life in their magic and intrigue.\\n\\nMy search has taken on many forms: from the halls of UC Berkeley, to the hustle of startup life in Silicon Valley, to obscure temples and ashrams in india. A long travel to come back home into the heart.\\n\\nFrom that home comes the offering of BookRetreats.com. A synergy of my passions: Yoga, the internet, and entrepreneurship. The integration of spirituality and the creative business spirit. I\'m happy you\'re joining the journey :)\"}', '8anOzegJReXkJyN6gLKRRJojca6hyp6MztE3KY3d.jpg', '2022-01-25 09:08:19', '2022-07-19 03:44:11'),
(2, '{\"en\":\"Anna Nazarova\",\"fr\":\"Anna Nazarova\",\"pt\":\"Anna Nazarova\"}', '{\"en\":\"Travel Expert\",\"pt\":\"Especialista em viagens\",\"fr\":\"Sp\\u00e9cialiste du voyage\"}', '{\"en\":\"My world cracked open one day while sitting on a simple brown bench listening to the flowing water pass by. It\'s when I first was reminded of my forgotten ability to lucid dream. From that moment in time 10 years ago, my life has been dedicated to unraveling the mysteries of life in their magic and intrigue. My search has taken on many forms: from the halls of UC Berkeley to the hustle of startup life in Silicon Valley, to obscure temples and ashrams in India. A long journey to come back home into the heart. From that home comes the offering of BookRetreats.com. A synergy of my passions: Yoga, the internet, and entrepreneurship. The integration of spirituality and the creative business spirit. I\'m happy you\'re joining the journey :)\",\"fr\":\"Mon monde s\'est ouvert un jour alors que j\'\\u00e9tais assis sur un simple banc marron en \\u00e9coutant le passage de l\'eau qui coule. C\'est \\u00e0 ce moment-l\\u00e0 que je me suis souvenu pour la premi\\u00e8re fois de ma capacit\\u00e9 oubli\\u00e9e \\u00e0 faire des r\\u00eaves lucides. Depuis ce moment il y a 10 ans, ma vie a \\u00e9t\\u00e9 consacr\\u00e9e \\u00e0 percer les myst\\u00e8res de la vie dans leur magie et leur intrigue. Ma recherche a pris de nombreuses formes\\u00a0: des couloirs de l\'UC Berkeley \\u00e0 l\'agitation de la vie des startups dans la Silicon Valley, en passant par les temples et les ashrams obscurs en Inde. Un long voyage pour rentrer dans le coeur. De cette maison vient l\'offre de BookRetreats.com. Une synergie de mes passions : le Yoga, internet, et l\'entrepreneuriat. L\'int\\u00e9gration de la spiritualit\\u00e9 et de l\'esprit d\'entreprise cr\\u00e9atif. Je suis content que tu fasses partie de l\'aventure :)\",\"pt\":\"Meu mundo se abriu um dia enquanto estava sentado em um simples banco marrom ouvindo a \\u00e1gua corrente passar. Foi quando me lembrei pela primeira vez da minha capacidade esquecida de sonhar l\\u00facido. Desde aquele momento, 10 anos atr\\u00e1s, minha vida tem sido dedicada a desvendar os mist\\u00e9rios da vida em sua magia e intriga. Minha busca assumiu muitas formas: dos corredores da UC Berkeley, \\u00e0 agita\\u00e7\\u00e3o da vida de startup no Vale do Sil\\u00edcio, a templos obscuros e ashrams na \\u00cdndia. Uma longa viagem para voltar para casa no cora\\u00e7\\u00e3o. A partir dessa casa vem a oferta de BookRetreats.com. Uma sinergia das minhas paix\\u00f5es: Yoga, internet e empreendedorismo. A integra\\u00e7\\u00e3o da espiritualidade e do esp\\u00edrito empresarial criativo. Estou feliz que voc\\u00ea est\\u00e1 se juntando \\u00e0 jornada :)\"}', 'ODhrMzedPEIp12JnjAm9lLvvRZq4QFKfwdv2Xbyk.jpg', '2022-04-17 01:33:47', '2022-07-19 03:44:19');
