(1, 21, 'Interdum et malesuada fames ac ante ipsum primis in faucibus. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Proin tempus, eros id scelerisque venenatis, lorem diam gravida ante, a mattis nibh metus quis velit. Fusce nec sem dui. Vivamus et libero eu nisl egestas tristique. Fusce finibus, sem ac pulvinar porta, risus ligula pharetra magna, ultrices vehicula augue nisi nec massa. Integer molestie imperdiet dignissim. Donec nisi dolor, facilisis ut arcu sed, semper fermentum tellus. Vestibulum non felis erat. Aenean et malesuada ex. In ac diam non mi maximus efficitur ornare suscipit magna. Nunc dictum enim non dolor lobortis eleifend. Quisque hendrerit, odio a dictum fermentum, magna ante euismod urna, vitae auctor neque mi ac erat.\n\nMaecenas malesuada pharetra turpis, sit amet scelerisque mauris. Nunc lacinia metus quis mi luctus, sit amet suscipit est mollis. Etiam ut eros mauris. Proin eget metus bibendum, euismod metus in, luctus risus. Fusce vel tortor facilisis, suscipit orci et, suscipit dui. Nam hendrerit feugiat gravida. Sed quis turpis blandit, volutpat urna non, ultricies mi. Praesent vitae turpis eleifend, ultricies tortor sed, scelerisque quam. Praesent fermentum risus vitae est vehicula, facilisis sollicitudin nisl egestas. Donec cursus lorem nec lorem malesuada aliquam.', '2014-12-30', NULL, 'Canada', '56 Reistwood Drive', NULL, 'Kitchener', 'Ontario', 'N2R 0N8', NULL, '2022-02-22 06:35:09', '2022-07-16 05:41:02'),
(2, 24, 'My world cracked open one day while sitting on a simple brown bench listening to the flowing water pass by. It\'s when I first was reminded of my forgotten ability to lucid dream. From that moment in time 10 years ago, my life has been dedicated to unraveling the mysteries of life in their magic and intrigue. My search has taken on many forms: from the halls of UC Berkeley, to the hustle of startup life in Silicon Valley, to obscure temples and ashrams in india. A long travel to come back home into the heart. From that home comes the offering of BookRetreats.com. A synergy of my passions: Yoga, the internet, and entrepreneurship. The integration of spirituality and the creative business spirit. I\'m happy you\'re joining the journey :)', NULL, NULL, 'Canada', '56 Reistwood Drive', NULL, 'Kitchener', 'Ontario', 'N2R 0N8', NULL, '2022-04-17 01:35:23', '2022-04-17 01:35:23');
